/data-pre-processing -with-data-reduction-techniques-in-python-ab02a98a7b69 Visualizing Data Trends Dr. Cristian López Del Alamo Research Group GINIA Source:https://scikit-learn.org/0.20/auto_examples/manifold/plot_compare_methods.html Improve Generalization Dr. Cristian López Del Alamo Research Group GINIA Source:https://towardsdatascience.com/geometric-priors-i-cc9dc748f08 Source:https://towardsdatascience.com/geometric-priors-i-cc9dc748f08 Source:https://towardsdatascience.com/geometric-priors-i-cc9dc748f08 The Curse of Dimensionality Dr. Cristian López Del Alamo Research Group GINIA Richard Bellman As the dimension increases, the volume of the space grows exponentially. This makes the data increasingly sparse √2 √n √3 En dimensiones distancia máxima dos puntos crece lentamente Source:https://www.nae.edu/189177/RICH ARD-E-BELLMAN-19201984 Useful for Dr. Cristian López Del Alamo Research Group GINIA Compression Removing redundancy Visualization Reducing time Complexity of downstream processing Implicitly Regularización Curse of dimensionality Principal Component Analysis (PCA) Principal Component Analysis (PCA) Dr. Cristian López Del Alamo Research Group GINIA What is PCA? Unsupervised technique for extracting variance structure from high dimensional datasets. PCA is an orthogonal projection or transformation of the data into subspace so that the variance of the projected data is maximized. Source:https://www.cs.cmu.edu/~epxing/Class/10701-08s/Lecture/lecture24-annotated.pdf Principal Component Analysis (PCA) Dr. Cristian López Del Alamo Research Group GINIA Intrinsically lower dimensional than the dimension of the ambient space. Can we transform the features so that we only need to preserve one latent feature? If we rotate data, again only one coordinate is more important. Source:https://www.cs.cmu.edu/~epxing/Class/10701-08s/Lecture/lecture24-annotated.pdf Principal Component Analysis (PCA) Dr. Cristian López Del Alamo Research Group GINIA PCA Objective Source:h